var $ = jQuery.noConflict();

jQuery(function () {
	isElementExist(".menu-drop", initSmartMenu);
	isElementExist(".header", initHeaderOffset);
	isElementExist(".swiper", initSwiper);
	isElementExist(".filters", initFilters);
	isElementExist(".team-tabset", initTabs);
	jcfInit();
});

window.addEventListener("load", () => {
	initSplitText();
	isElementExist(".articles-carousel", sliderAnimationReset);
	addBoxLine();
	hidePreloader();
	initAnimations();
	console.log(window.scrollY)
	console.log(document.querySelector('.info-slider').getBoundingClientRect().top)

	setTimeout(() => {
		console.log(window.scrollY)
		console.log(document.querySelector('.info-slider').getBoundingClientRect().top)
	}, 1000)
});

