// Helper if element exist then call function
function isElementExist(_el, _cb) {
	var elem = document.querySelector(_el);

	if (document.body.contains(elem)) {
		try {
			_cb();
		} catch (e) {
			console.log(e);
		}
	}
}

// initialize custom form elements (checkbox, radio, select) https://github.com/w3co/jcf
function jcfInit() {
	var customSelect = jQuery("select");
	var customCheckbox = jQuery('input[type="checkbox"]');
	var customRadio = jQuery('input[type="radio"]');

	customSelect.each(function () {
		$(this).find("option").first().addClass("placeholder");
	});

	// all option see https://github.com/w3co/jcf
	jcf.setOptions("Select", {
		wrapNative: false,
		wrapNativeOnMobile: false,
		fakeDropInBody: false,
		maxVisibleItems: 6,
	});

	jcf.setOptions("Checkbox", {});

	jcf.setOptions("Radio", {});

	// init only after option
	jcf.replace(customSelect);
	jcf.replace(customCheckbox);
	jcf.replace(customRadio);

	customSelect.each(function () {
		$(this).find("option").first().addClass("placeholder");
	});
}

// smart menu init
function initSmartMenu() {
	var distanceBetweenMenuAndNav =
		jQuery(".header").offset().top +
		jQuery(".header").innerHeight() -
		jQuery(".menu-drop__wrap").offset().top -
		jQuery(".menu-drop__wrap").innerHeight();
	jQuery(".menu").smartmenus({
		collapsibleBehavior: "accordion",
		mainMenuSubOffsetY: distanceBetweenMenuAndNav,
	});

	// changed date attribute to a class (need to reverse last item menu)
	jQuery(".menu").children().last().addClass("menu-sm-reverse");

	jQuery("body").mobileNav({
		menuActiveClass: "menu-active",
		menuOpener: ".menu-opener",
		hideOnClickOutside: true,
		menuDrop: ".menu-drop",
	}),
		"ontouchstart" in document.documentElement ||
		jQuery(window).on("resize orientationchange", function () {
			jQuery("body").removeClass("menu-active"), $.SmartMenus.hideAll();
		});
}

function initHeaderOffset() {
	let container = jQuery(".offset-header");
	let header = jQuery(".header");
	let adjustDebounced = debounce(function () {
		adjustHeightOffset();
	}, 250);

	function adjustHeightOffset() {
		headerHeight = header.outerHeight();
		container.css("padding-top", headerHeight);
	}

	adjustHeightOffset();

	jQuery(window).on("resize", adjustDebounced);
}

// initialize swiper slider
function initSwiper() {
	let infoSwiper = jQuery(".info-slider");

	infoSwiper.each(function (index, slider) {
		let $this = jQuery(this),
			container = $this.find(".swiper")[0],
			navNext = $this.find(".swiper-button-next")[0],
			navPrev = $this.find(".swiper-button-prev")[0];
		pagination = $this.find(".swiper-pagination")[0];

		let swiper = new Swiper(container, {
			loop: true,
			pagination: {
				el: pagination,
				type: "fraction",
			},
			navigation: {
				nextEl: navNext,
				prevEl: navPrev,
			},
		});
	});

	let quoteSlider = jQuery(".quote-module");

	quoteSlider.each(function (index, slider) {
		let $this = jQuery(this),
			container = $this.find(".swiper")[0],
			navNext = $this.find(".swiper-button-next")[0],
			navPrev = $this.find(".swiper-button-prev")[0];
		pagination = $this.find(".swiper-pagination")[0];

		let swiper = new Swiper(container, {
			loop: true,
			pagination: {
				el: pagination,
				type: "fraction",
			},
			navigation: {
				nextEl: navNext,
				prevEl: navPrev,
			},
		});
	});

	const mediaQuery = window.matchMedia("(max-width: 1023px)");

	if (mediaQuery.matches) {
		let articlesCarousel = jQuery(".articles-carousel");

		articlesCarousel.each(function (index, slider) {
			let $this = jQuery(this),
				container = $this.find(".swiper")[0],
				navNext = $this.find(".swiper-button-next")[0],
				navPrev = $this.find(".swiper-button-prev")[0];
			pagination = $this.find(".swiper-pagination")[0];
			slides = $this.find(".swiper-slide");

			let swiper = new Swiper(container, {
				loop: true,
				autoHeight: true,
				pagination: {
					el: pagination,
					type: "fraction",
				},
				navigation: {
					nextEl: navNext,
					prevEl: navPrev,
				},
			});
		});
	}
}

function initFilters() {
	let filter = $(".filters"),
		filterOpener = filter.find(".filters__opener"),
		filterSlide = filter.find(".filters__body");

	$(function () {
		filterOpener.click(function () {
			filter.toggleClass("opened");
			filterSlide.slideToggle();
		});
	});
}

function initTabs() {
	jQuery(".team-tabset").tabset({
		tabLinks: "a",
		addToParent: true,
		defaultTab: true,
	});
}

function sliderAnimationReset() {
	const articleSlider = document.querySelectorAll(".articles-carousel");
	const BREAKPOINT = window.innerWidth < 1023;

	if (BREAKPOINT) {
		articleSlider.forEach(slider => {
			const slides = slider.querySelectorAll(".swiper-slide");

			slides.forEach((slide, index) => {
				if(index > 0) {
					slide.classList.remove('anim-section');
				}
			})
		})
	}
}

function initSplitText() {
	const rowsElements = document.querySelectorAll(".split-text-rows");

	function splitText(textElement, classes) {
		new SplitType(textElement, {
			types: "lines",
			tagName: "span",
			lineClass: classes,
		});
	}

	rowsElements.forEach(item => {
		const strong = item.querySelector('strong');

		splitText(item, "split-text-row fade-in");

		if (strong) {
			splitText(strong, "split-text-row");
			const strongRows = strong.querySelectorAll(".split-text-row");

			if (strongRows.length > 1) {
				strong.parentElement.classList.remove('fade-in');
				strongRows.forEach(item => {
					item.classList.add('fade-in');
				})
			}
		};
	});
}

function addBoxLine() {
	const boxes = document.querySelectorAll(".text-line-box");

	function addLine(box) {
		const textRows = box.querySelectorAll('.split-text-row');
		const strong = box.querySelector('strong');
		const lastRow = textRows[textRows.length - 1];

		lastRow.style.display = "inline-block";
		lastRow.style.width = "initial";

		const lastRowWidth = lastRow.clientWidth;
		const line = document.createElement("span");

		line.style.maxWidth = `${lastRowWidth}px`;
		line.classList.add("split-text-row", "text-line", "fade-in");

		if (strong) {
			strong.append(line);
		} else {
			box.append(line);
		}
	}

	boxes.forEach(addLine);
}

function initAnimations() {
	const EASING_OUT = "cubicBezier(0.25, 0.6, 0.51, 0.91)"

	function getScrollPos(section) {
		const elementTop = section.getBoundingClientRect().top;
		const elementMiddle = elementTop + section.clientHeight / 2;

		return window.scrollY > elementMiddle;
	}

	function initSectionAnimation() {
		const sections = document.querySelectorAll(".anim-section");

		function sectionAnimation(section) {
			const isElementVisible = getScrollPos(section);

			if (isElementVisible) return;

			const isIntroAnimation = section.classList.contains("anim-intro");
			const fadeInElements = section.querySelectorAll(".fade-in");
			const fadeDownElements = section.querySelectorAll(".fade-down");
			const slideInElements = section.querySelectorAll(".slide-in");
			const directionArrowLine = section.querySelectorAll(".anim-arrow__line");
			const directionArrowChevron = section.querySelectorAll(".anim-arrow__chevron");
			const timeline = anime.timeline({easing: EASING_OUT});
			const scroller = scrollama();

			function initTimeline() {
				timeline
					.add({
						targets: slideInElements,
						opacity: 1,
						translateY: 0,
						duration: 1600,
					})
					.add(
						{
							targets: fadeInElements,
							opacity: 1,
							translateY: 0,
							duration: 1000,
							delay: anime.stagger(200),
						},
						`${!isIntroAnimation ? '0' : '-=1000'}`
					)
					.add(
						{
							targets: fadeDownElements,
							duration: 1000,
							opacity: 1,
							translateY: 0,
						},
						"-=600"
					)
					.add(
						{
							targets: directionArrowLine,
							strokeDashoffset: [anime.setDashoffset, 0],
							duration: 1000,
							opacity: 1,
						},
						"-=1000"
					)
					.add(
						{
							targets: directionArrowChevron,
							strokeDashoffset: [anime.setDashoffset, 0],
							opacity: 1,
							duration: 1000,
						},
					);
			}

			function setStyles() {
				anime.set(fadeInElements, {
					opacity: 0,
					translateY: "70px",
				});

				anime.set(directionArrowLine, {
					opacity: 0,
				});

				anime.set(directionArrowChevron, {
					opacity: 0,
				});

				anime.set(fadeDownElements, {
					opacity: 0,
					translateY: "-80px",
				});

				anime.set(slideInElements, {
					translateY: "100%",
				});
			}

			setStyles();

			if (isIntroAnimation) {
				initTimeline();
				return;
			}

			scroller
				.setup({ step: section, once: true, offset: 0.7 })
				.onStepEnter(initTimeline);
		}

		sections.forEach(sectionAnimation);
	}

	function initSlideInSingle() {
		const slideInElements = document.querySelectorAll(".slide-in-single");

		function slideInSingle(element) {
			const isElementVisible = getScrollPos(element);

			if (isElementVisible) return;

			const scroller = scrollama();

			anime.set(element, {
				translateY: "100%",
				opacity: 0,
			});

			scroller
				.setup({ step: element, once: true, offset: 1 })
				.onStepEnter(() => {
					anime.set(element, {
						opacity: 1,
					});

					anime({
						targets: element,
						duration: 1400,
						translateY: 0,
						easing: EASING_OUT,
					});
				});
		}

		slideInElements.forEach(slideInSingle);
	}

	function initFadeDownSingle() {
		const fadeDownElements = document.querySelectorAll(".fade-down-single");

		function fadeDownSingle(element) {
			const isElementVisible = getScrollPos(element);

			if (isElementVisible) return;

			const scroller = scrollama();

			anime.set(element, {
				translateY: "-80%",
				opacity: 0,
			});

			scroller
				.setup({ step: element, once: true, offset: 0.7 })
				.onStepEnter(() => {
					anime({
						targets: element,
						duration: 1000,
						opacity: 1,
						translateY: 0,
						easing: EASING_OUT,
					});
				});
		}

		fadeDownElements.forEach(fadeDownSingle);
	}

	function initFadeInGridRows() {
		const grid = document.querySelectorAll('.anim-grid-rows');

		if (!grid) return;

		grid.forEach(item => {
			const splitRows = Splitting({
				target: item,
				by: 'rows',
				matching: '.fade-in'
			});

			const rows = splitRows[0].rows;

			function fadeInRow(row) {
				const triggerElement = row[0];
				const isElementVisible = getScrollPos(triggerElement);

				if (isElementVisible) return;

				const scroller = scrollama();

				anime.set(row, {
					translateY: "30%",
					opacity: 0,
				});

				scroller
					.setup({ step: triggerElement, once: true, offset: 0.8 })
					.onStepEnter(() => {
						anime({
							targets: row,
							duration: 1200,
							opacity: 1,
							translateY: 0,
							delay: anime.stagger(200),
							easing: EASING_OUT,
						});
					});
			}

			rows.forEach(fadeInRow);
		})
	}

	function initMenuAnimation() {
		const menuItems = document.querySelectorAll(".menu-animated-item");
		const trigger = document.querySelector(".menu-opener");

		trigger.addEventListener("click", handleClick);

		anime.set(menuItems, {
			translateY: "100%",
			opacity: 0,
		});

		function handleClick() {
			anime({
				targets: menuItems,
				duration: 800,
				easing: EASING_OUT,
				translateY: 0,
				opacity: 1,
				delay: anime.stagger(150, { start: 0 }),
			});
		}
	}

	function initDrawSingleArrow() {
		const arrows = document.querySelectorAll('.draw-arrow');

		function drawArrow(arrow) {
			const isElementVisible = getScrollPos(arrow);

			if (isElementVisible) return;

			const line = arrow.querySelectorAll('.anim-arrow__line');
			const chevron = arrow.querySelectorAll('.anim-arrow__chevron');
			const timeline = anime.timeline();
			const scroller = scrollama();

			anime.set(line, {
				opacity: 0,
			});

			anime.set(chevron, {
				opacity: 0,
			});

			function initTimeline() {
				timeline
					.add(
						{
							targets: line,
							strokeDashoffset: [anime.setDashoffset, 0],
							duration: 1300,
							opacity: 1,
							easing: EASING_OUT
						}
					)
					.add(
						{
							targets: chevron,
							strokeDashoffset: [anime.setDashoffset, 0],
							opacity: 1,
							easing: EASING_OUT,
							duration: 700,
						},
					);
			}

			scroller
				.setup({ step: arrow, once: true, offset: 0.7 })
				.onStepEnter(initTimeline);
		}

		arrows.forEach(drawArrow);
	}

	initSectionAnimation();
	initDrawSingleArrow();
	initFadeInGridRows();
	initMenuAnimation();
	initSlideInSingle();
	initFadeDownSingle();
}

function hidePreloader() {
	const preloader = document.querySelector(".preloader");
	const contentWrapper = document.querySelector(".wrapper");

	if (!preloader) return;

	contentWrapper.classList.remove("wrapper--hidden");

	setTimeout(() => {
		preloader.classList.add("preloader--hidden");
	}, 200);
}

